contracts/Storefront.sol.content:
// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interface/IBlastPoints.sol";


contract Storefront is ERC721, ERC721Enumerable, ERC721Burnable, Ownable {
    uint256 private _nextTokenId;

    // The Storefront NFT minting price
    uint256 public mintPrice;
    address public feeRecipient;

    /** BlastPoints Point Operator contract address
    testnet BlastPointsAddress = 0x2fc95838c71e76ec69ff817983BFf17c710F34E0 
    mainnet BlastPointsAddress = 0x2536FE9ab3F511540F2f9e2eC2A805005C3Dd800
    */ 
    address BlastPointsAddress = 0x2fc95838c71e76ec69ff817983BFf17c710F34E0;

    constructor(address initialOwner, address _pointsOperator, uint256 _mintPrice)
        ERC721("Storefront", "STR")
        Ownable(initialOwner)
    {
        mintPrice = _mintPrice;
        feeRecipient = initialOwner;
        IBlastPoints(BlastPointsAddress).configurePointsOperator(_pointsOperator);
    }

    function _baseURI() internal pure override returns (string memory) {
        return "pinata";
    }

    function safeMint(address to) public payable {
        require(msg.value == mintPrice, "Insufficient Minting Price");
        uint256 tokenId = _nextTokenId++;
        _safeMint(to, tokenId);
        (bool sent, bytes memory data) = feeRecipient.call{value: msg.value}("");
        require(sent, "Failed to send Ether");    
    }

    function setMintPrice(uint256 newMintPrice) public onlyOwner {
        mintPrice = newMintPrice;
    }

    function setFeeRecipient(address payable _feeRecipient) public onlyOwner {
        feeRecipient = _feeRecipient;
    }

    // The following functions are overrides required by Solidity.
    function _update(address to, uint256 tokenId, address auth)
        internal
        override(ERC721, ERC721Enumerable)
        returns (address)
    {
        return super._update(to, tokenId, auth);
    }

    function _increaseBalance(address account, uint128 value)
        internal
        override(ERC721, ERC721Enumerable)
    {
        super._increaseBalance(account, value);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    // test function for Blast testnet
    receive() external payable {}

    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }
}

